import React, { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import "../../styles/TeacherDashboard.css";

const TeacherSidebar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  // Track open dropdown and active path
  const [activeDropdown, setActiveDropdown] = useState(null);

  // Set active dropdown automatically based on route
  useEffect(() => {
    if (location.pathname.includes("/create-course") || location.pathname.includes("/view-courses") || location.pathname.includes("/course-detail")) {
      setActiveDropdown("course");
    } else if (location.pathname.includes("/create-mcq") || location.pathname.includes("/update-mcq")) {
      setActiveDropdown("mcq");
    } else {
      setActiveDropdown(null);
    }
  }, [location.pathname]);

  const toggleDropdown = (menu) => {
    setActiveDropdown(activeDropdown === menu ? null : menu);
  };

  return (
    <aside className="teacher-sidebar">
      {/* ===== DASHBOARD ===== */}
      <button
        className={location.pathname === "/teacher-dashboard" ? "active" : ""}
        onClick={() => navigate("/teacher-dashboard")}
      >
        <i className="fa-solid fa-house"></i> Dashboard
      </button>

      {/* ===== COURSES SECTION ===== */}
      <div className="dropdown">
        <button
          className={
            activeDropdown === "course" ||
            location.pathname.includes("/create-course") ||
            location.pathname.includes("/view-courses") ||
            location.pathname.includes("/course-detail")
              ? "active"
              : ""
          }
          onClick={() => toggleDropdown("course")}
        >
          <i className="fa-solid fa-book"></i> Courses
        </button>

        {activeDropdown === "course" && (
          <div className="dropdown-menu">
            <ul>
              <li
                className={
                  location.pathname === "/create-course" ? "active" : ""
                }
                onClick={() => navigate("/create-course")}
              >
                Create Course
              </li>

              <li
                className={
                  location.pathname === "/view-courses" ? "active" : ""
                }
                onClick={() => navigate("/view-courses")}
              >
                View Courses
              </li>

              <li
                className={
                  location.pathname.includes("/course-detail") ? "active" : ""
                }
                onClick={() => navigate("/view-courses")}
              >
                Course Detail
              </li>
            </ul>
          </div>
        )}
      </div>

      {/* ===== MCQ MANAGEMENT ===== */}
      <div className="dropdown">
        <button
          className={
            activeDropdown === "mcq" ||
            location.pathname.includes("/create-mcq") ||
            location.pathname.includes("/update-mcq")
              ? "active"
              : ""
          }
          onClick={() => toggleDropdown("mcq")}
        >
          <i className="fa-solid fa-list-check"></i> MCQ Management
        </button>

        {activeDropdown === "mcq" && (
          <div className="dropdown-menu">
            <ul>
              <li
                className={
                  location.pathname === "/create-mcq" ? "active" : ""
                }
                onClick={() => navigate("/create-mcq")}
              >
                Create MCQ
              </li>

              <li
                className={
                  location.pathname === "/update-mcq" ? "active" : ""
                }
                onClick={() => navigate("/update-mcq")}
              >
                Update MCQ
              </li>
            </ul>
          </div>
        )}
      </div>

      {/* ===== CASE STUDIES ===== */}
      <button
        className={location.pathname === "/case-studies" ? "active" : ""}
        onClick={() => navigate("/case-studies")}
      >
        <i className="fa-solid fa-briefcase"></i> Case Studies
      </button>

      {/* ===== REPORTS ===== */}
      <button
        className={location.pathname === "/reports" ? "active" : ""}
        onClick={() => navigate("/reports")}
      >
        <i className="fa-solid fa-chart-line"></i> Reports
      </button>
    </aside>
  );
};

export default TeacherSidebar;
